// DonorMap.jsx — aggressive diagnostic (replace your file with this)
import React, { useRef, useEffect, useState } from "react";
import { GoogleMap, useJsApiLoader } from "@react-google-maps/api";

const containerStyle = { width: "100%", height: "400px" };

export default function DonorMap({ recipientLocation, donors = [], searchRadiusMiles = 25 }) {
  const mapRef = useRef(null);
  const markersRef = useRef([]);
  const [mapReady, setMapReady] = useState(false);

  const apiKey = process.env.REACT_APP_GOOGLE_MAPS_API_KEY;
  const { isLoaded, loadError } = useJsApiLoader({ googleMapsApiKey: apiKey });

  // normalization: accept { latitude, longitude } or GeolocationPosition or { lat, lng }
  const normalized = (() => {
    if (!recipientLocation) return null;
    if (typeof recipientLocation.latitude === "number" && typeof recipientLocation.longitude === "number")
      return { lat: Number(recipientLocation.latitude), lng: Number(recipientLocation.longitude) };
    if (typeof recipientLocation.lat === "number" && typeof recipientLocation.lng === "number")
      return { lat: Number(recipientLocation.lat), lng: Number(recipientLocation.lng) };
    if (recipientLocation.coords && typeof recipientLocation.coords.latitude === "number")
      return { lat: Number(recipientLocation.coords.latitude), lng: Number(recipientLocation.coords.longitude) };
    return null;
  })();

  const fallbackCenter = { lat: 12.9716, lng: 77.5946 };

  useEffect(() => {
    console.log("Diagnostic render — recipientLocation (raw):", recipientLocation);
    console.log("Diagnostic render — normalized:", normalized);
  }, [recipientLocation]);

  useEffect(() => {
    if (!isLoaded) {
      console.log("Maps API not loaded yet: isLoaded=", isLoaded);
      return;
    }
    if (!mapRef.current) {
      console.log("mapRef not set yet");
      return;
    }

    // cleanup previous markers
    markersRef.current.forEach(m => m && m.setMap(null));
    markersRef.current = [];

    const map = mapRef.current;
    console.log("Diagnostic: map object present:", !!map);

    // Force center & zoom so markers are clearly visible
    const center = normalized || fallbackCenter;
    map.setCenter(center);
    map.setZoom(13);
    console.log("Diagnostic: map.setCenter ->", center, "zoom=13");

    try {
      // Add a strong fallback marker via direct Maps API (guaranteed visible)
      const fallback = new window.google.maps.Marker({
        position: fallbackCenter,
        map,
        title: "Fallback test marker",
        label: { text: "FALLBACK", color: "white", fontWeight: "700" }
      });
      markersRef.current.push(fallback);
      console.log("Diagnostic: fallback marker added at", fallbackCenter);

      // If we have normalized user coords, add a prominent user marker
      if (normalized) {
        const userMarker = new window.google.maps.Marker({
          position: normalized,
          map,
          title: "User location (diagnostic)",
          label: { text: "YOU", color: "white", fontWeight: "700" },
          zIndex: 9999
        });
        markersRef.current.push(userMarker);
        console.log("Diagnostic: user marker added at", normalized);
      } else {
        console.log("Diagnostic: no normalized user coords; user marker skipped");
      }

      // Add donor markers via direct API and log if coords invalid
      donors.forEach((d, i) => {
        const lat = Number(d?.location?.latitude);
        const lng = Number(d?.location?.longitude);
        if (Number.isNaN(lat) || Number.isNaN(lng)) {
          console.log("Diagnostic: skipping donor (invalid coords):", d);
          return;
        }
        const mk = new window.google.maps.Marker({
          position: { lat, lng },
          map,
          title: `Donor ${d.name || d.email || i}`,
          label: { text: String(i + 1), color: "black" }
        });
        markersRef.current.push(mk);
        console.log("Diagnostic: donor marker added", { index: i, pos: { lat, lng }, donor: d });
      });

      // Log map bounds, center, zoom
      setTimeout(() => {
        console.log("Diagnostic: map.getCenter():", map.getCenter() && map.getCenter().toJSON());
        console.log("Diagnostic: map.getZoom():", map.getZoom());
        console.log("Diagnostic: map.getBounds():", map.getBounds() && map.getBounds().toJSON());
      }, 300);

      setMapReady(true);
    } catch (e) {
      console.error("Diagnostic: exception while placing markers:", e);
    }

    return () => {
      markersRef.current.forEach(m => m && m.setMap(null));
      markersRef.current = [];
      console.log("Diagnostic: cleaned up markers");
    };
  }, [isLoaded, normalized, donors]);

  if (loadError) return <div>Map load error: {String(loadError)}</div>;
  if (!isLoaded) return null;

  return (
    <GoogleMap
      mapContainerStyle={containerStyle}
      center={normalized || fallbackCenter}
      zoom={normalized ? 13 : 11}
      onLoad={(map) => {
        mapRef.current = map;
        console.log("Diagnostic: GoogleMap onLoad fired, mapRef set");
      }}
    />
  );
}
